import { useHistory } from "react-router-dom/cjs/react-router-dom.min";

function Soup () {

    const history = useHistory()

    let toggleDisplay = 'hide-hint';

    const codeBlock = 
    `
    <html>
        <head>
        <head>
        <body>
        </body>
    </html>
    `

    return (
        <div>
            <h1> Soup </h1>
            <h2>Add a header element with your favorite food!</h2>
            <textarea defaultValue={codeBlock}></textarea>
            <h3 className={toggleDisplay}>Does header have an opening and closing tag?</h3>
            <div className="pageButtons">
            <button onClick={() => toggleDisplay ? console.log('true') : toggleDisplay = 'hide-hint'}>Hint</button>
            <button>View Solution</button>
            <button>Submit</button>
            </div>       
            <button onClick={() => history.push('/')}>Home</button>
        </div>
    )
}

export default Soup;
